import './Home.scss';
export default function Home() {
  return (
    <div className='home'>
      <div className='about-me'>
        <h2>Pershendetje,emri im eshte Altin Alidema</h2>
      </div>
      <div className='pershkrim'>
          <h4>Front-End Developer</h4>
      </div>
    </div>
  )
}
